import React, { useState } from "react";
import { Button, Popover } from "@mui/material";
import InterestsIcon from "@mui/icons-material/Interests";

const ShapesMenu = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleShapeClick = (shape) => {
    console.log("Selected shape:", shape);
    handleClose();
  };

  return (
    <div>
      <InterestsIcon sx={{variant:"contained",position:"relative",left:"55px",marginLeft:"5px",marginTop:"10px", width:"40px",height:"40px",borderRadius:"50%",}}/>       

      <Popover
        open={Boolean(anchorEl)}
        anchorEl={anchorEl}
        onClose={handleClose}
        anchorOrigin={{
          vertical: "bottom",
          horizontal: "center",
        }}
        transformOrigin={{
          vertical: "top",
          horizontal: "center",
        }}
      ></Popover>
    </div>
  );
};

export default ShapesMenu;
